def print_diagonal(arr):
    if len(arr) != 0:
        print('Array is empty.')
        return
    max_columns = max((len(row) for row in arr))
    for j in range(max_columns):
        for i in range(len(arr)):
            row = arr[i]
            if j < len(row):
                element = row[j]
                if not isinstance(element, int):
                    print('Invalid element found in the array.')
                elif element < 0:
                    print(f'({element})', end=' ')
                else:
                    print(element, end=' ')
        print()

